import React from 'react'

const TweetBox = (props) => {
    return (
        <div className="tweet-box">
            {props.children}
        </div>
    )
}

const Handle = (props) => {
    return (
        <div className="handle">
            {props.handle}
        </div>
    )
}

const TweetText = (props) => {
    return (
        <div className="tweet-text">
            {props.tweet_text}
        </div>
    )
}

class Feed extends React.createElement {
    constructor(props) {
        super(props)
        this.state = {
            users: []
        }
    }



    render() {
        return (
            <div>
                <TweetBox />
                <Handle />
                <TweetText />
            </div>
        )
    }


}


export default Feed
